import React from 'react';  
import { Link } from 'react-scroll';  
import './Navbar.css';  

const Navbar = () => {  
  const handleLinkClick = (to) => {  
   console.log(`Clicked on ${to}`);  
   // You can add additional logic here to handle the click event  
  };  

  return (  
   <nav className="navbar">  
    <ul className="navbar-links">  
      <li>  
       <Link  
        to="hero"  
        smooth={true}  
        duration={500}  
        spy={true}  
        activeClass="active"  
        offset={-50}  
        onClick={() => handleLinkClick('hero')}  
       >  
        Home  
       </Link>  
      </li>  
      <li>  
       <Link  
        to="bio"  
        smooth={true}  
        duration={500}  
        spy={true}  
        activeClass="active"  
        offset={-50}  
        onClick={() => handleLinkClick('bio')}  
       >  
        Bio  
       </Link>  
      </li>  
      <li>  
       <Link  
        to="experience"  
        smooth={true}  
        duration={500}  
        spy={true}  
        activeClass="active"  
        offset={-50}  
        onClick={() => handleLinkClick('experience')}  
       >  
        Experience  
       </Link>  
      </li>  
      <li>  
       <Link  
        to="projects"  
        smooth={true}  
        duration={500}  
        spy={true}  
        activeClass="active"  
        offset={-50}  
        onClick={() => handleLinkClick('projects')}  
       >  
        Projects  
       </Link>  
      </li>  
      <li>  
       <Link  
        to="contact"  
        smooth={true}  
        duration={500}  
        spy={true}  
        activeClass="active"  
        offset={-50}  
        onClick={() => handleLinkClick('contact')}  
       >  
        Contact  
       </Link>  
      </li>  
    </ul>  
   </nav>  
  );  
};  

export default Navbar;
